        accountId = codec::get_fixed_string(buf, 12);
        branchId = codec::get_fixed_string(buf, 4);
        orderRestrictions = codec::get_fixed_string(buf, 4);
        side = codec::get_fixed_string(buf, 1);
        ordType = codec::get_fixed_string(buf, 1);
